import Vue from "vue";
import VueRouter from "vue-router";
import HomeView from "../views/HomeView.vue";

import Libros from "../views/LibrosView.vue";
import Solicitudes from "../views/solicitudesView.vue";
import Autores from "../views/AutoresView.vue";
import Editoriales from "../views/EditorialesView.vue";
import Administradores from "../views/AdministradoresView.vue";

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  {
    path: "/editoriales",
    name: "editoriales",
    component: Editoriales,
  },
  {
    path: "/administradores",
    name: "administradores",
    component: Administradores,
  },

  {
    path: "/about",
    name: "about",
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ "../views/AboutView.vue"),
  },
  {
    path: "/libros",
    name: "libros",
    component: Libros,
  },
  {
    path: "/solicitudes",
    name: "librosolicitudess",
    component: Solicitudes,
  },
  {
    path: "/autores",
    name: "autores",
    component: Autores,
  },
];

const router = new VueRouter({
  routes,
});

export default router;
